import React, { useState, useEffect } from "react";
const SearchBar = (props) => {
	const [cpResult, setCpResult] = useState({});
	useEffect(() => {
		const result = [];
		for (const item of props.queryCpObj.location) {
			for (const element of props.queryCpObj.availability) {
				if (item.car_park_no === element.carpark_number) {
					result.push({
						address: item.address,
						availableLots: element.carpark_info[0].lots_available,
						totalLots: element.carpark_info[0].total_lots,
						nonSeasonLot: item.short_term_parking,
						freeParking: item.free_parking,
						cpId: item.car_park_no,
					});
				}
			}
		}
		console.log(props.queryCpObj.availability[0].total_lots);
		console.log(props.queryCpObj.location[0].free_parking);
		setCpResult(result);
	}, [props.bool]);
	return (
		<form onSubmit={props.handleSubmit}>
			<input type="text" name="query" />
			<input type="submit" />
			<div>{cpResult}</div>
		</form>
	);
};

export default SearchBar;
